import React from "react";
import './About.css'; // Import your CSS file for styling
import FLL from '../assets/FLL.jpg'
const About = () => {
  return (
    <div className="about-container">
      <div className="about-text">
        <h1>About Our Project</h1>
        <p>
          Welcome to our innovative project, "The Anti-Algorithm"! Our goal is to revolutionize the way you think about recommendations by introducing a fun and surprising twist. Instead of suggesting items you may like, we intentionally mismatch your preferences with recommendations that are completely unrelated. 
        </p>
        <p>
          Whether you're a fan of action movies, romance novels, or pop music, we have something completely unexpected for you! Our unique system is designed to provoke laughter and spark curiosity, making your exploration of new content an enjoyable experience.
        </p>
        <p>
          Join us on this quirky adventure and discover the unexpected. Who knows? You might find joy in the most unusual recommendations!
        </p>
      </div>
      <div className="about-image">
        <img src={FLL} alt="About Our Project" />
      </div>
    </div>
  );
};

export default About;
